        tree[a - 1].append(b - 1)
        tree[b - 1].append(a - 1)


    def dfs(tree, x, visit):
        visit[x] = True
        for i in tree[x]:
            if not visit[i]:
                dfs(tree, i, visit)


    visit = [False] * n
    res = 0
    for i in range(n):
        if not visit[i]:
            dfs(tree, i, visit)
            res += 1

    return res

