    a = [
        [int(s) for s in stdin.split()]
        for _ in range(n)
    ]
    def search_numbers(i, j):
        s = a[i][j]
        while i < n and j < m:
            s += a[i][j]
            i += 1
            j += 1
        if j == m:
            return s
        if j < m:
            return search_numbers(i, j + 1)
        else:
            return search_numbers(i + 1, j)

    def check_numbers(i, j):
        if i < n and j < m:
            return a[i][j] % k == 0

    max_sum = 0
    for i in range(n):
        for j in range(m // 2):
            s = search_numbers(i, j)
            if check_numbers(i, j + (m // 2)):
                max_sum = max(max_sum, s)
    return str(max_sum)


