    def dp(i, num_pockets):
        if i == n:
            return 0
        if num_pockets == 0:
            return float("inf")
        if (i, num_pockets) in memo:
            return memo[(i, num_pockets)]

        tmp = float("inf")
        for j in range(a[i], num_pockets+1):
            tmp = min(tmp, 1 + dp(i+1, j-a[i]))

